import{_ as e,o as t,c as a,O as n}from"./chunks/framework.9482e208.js";const g=JSON.parse('{"title":"§ 23.1-637 Virginia Guaranteed Assistance Fund.","description":"","frontmatter":{},"headers":[],"relativePath":"vacode/23.1-637.md","filePath":"vacode/23.1-637.md"}'),r={name:"vacode/23.1-637.md"},i=n('<h1 id="§-23-1-637-virginia-guaranteed-assistance-fund" tabindex="-1">§ 23.1-637 Virginia Guaranteed Assistance Fund. <a class="header-anchor" href="#§-23-1-637-virginia-guaranteed-assistance-fund" aria-label="Permalink to &quot;§ 23.1-637 Virginia Guaranteed Assistance Fund.&quot;">​</a></h1><p>There is created in the state treasury a special nonreverting fund to be known as the Virginia Guaranteed Assistance Fund (the Fund). The Fund shall be established on the books of the Comptroller. All moneys as may be appropriated by the General Assembly and any gifts, donations, grants, bequests, or other moneys as may be received for the purposes of the Fund shall be paid into the state treasury and credited to the Fund. Interest earned on moneys in the Fund shall remain in the Fund and be credited to it. Any moneys remaining in the Fund, including interest thereon, at the end of each fiscal year shall not revert to the general fund but shall remain in the Fund. Moneys in the Fund shall be paid to any public institution of higher education on behalf of students who have been awarded grants pursuant to the provisions of § <a href="http://law.lis.virginia.gov/vacode/23.1-638/" target="_blank" rel="noreferrer">23.1-638</a>. Any moneys remaining in the Fund shall be credited to the account of the Council. Expenditures and disbursements from the Fund shall be made by the State Treasurer on warrants issued by the Comptroller upon written request signed by the director of the Council.</p><p>1992, c. 879, § 23-38.53:5; 1994, c. <a href="http://lis.virginia.gov/cgi-bin/legp604.exe?941+ful+CHAP0789" target="_blank" rel="noreferrer">789</a>; 2016, c. <a href="http://lis.virginia.gov/cgi-bin/legp604.exe?161+ful+CHAP0588" target="_blank" rel="noreferrer">588</a>.</p>',3),s=[i];function o(d,h,l,u,c,p){return t(),a("div",null,s)}const _=e(r,[["render",o]]);export{g as __pageData,_ as default};
